vec3 sdfCircle(vec2 uv, float r) {
  float x = uv.x;
  float y = uv.y;

  float d = length(vec2(x, y)) - r;

  return d > 0.4 ? vec3(0.) :0.5+0.2*sin(iTime+uv.x*uv.y+vec3(8,5,8))+0.9*cos(iTime+uv.xxx*uv.x+uv.yyy*uv.y+vec3(13,21,34));
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{

  vec2 uv = fragCoord/iResolution.xy; 
  uv -= 0.5;
  uv.x *= iResolution.x/iResolution.y;

  vec3 col = sdfCircle(uv, 0.);


  fragColor = vec4(col,0.3);

}
